import React, { useEffect, useState } from 'react';
import { Grid, Button } from '@mui/material';
import BlueBg from '../../assets/images/subscription-blue.png';
import GreenBg from '../../assets/images/subscription-green.png';
import { useNavigate, useLocation } from 'react-router-dom';
import EastIcon from '@mui/icons-material/East';
import { ReactComponent as PartTimerBanner } from '../../assets/images/subscriptionBg1.svg';
import { ReactComponent as EmployerBanner } from '../../assets/images/subscriptionBg2.svg';
import './subscription-style.scss'
import { EmployeeSubscriptionCreate, EmployeeSubscriptionRenewal, EmployeeSubscriptionView, EmployerProfile, EmployerSubscriptionCreate, employeeProfile } from '../../sevices/account';
import { ENV_CONFIG } from '../../constant';

function EmployeeSubscriptionComponent() {

  const stripe = require('stripe')(ENV_CONFIG.STRIPE_KEY);
  const location = useLocation();
  const searchParams = new URLSearchParams(location.search);
  const renew = searchParams.get('data');
  const [payment, setPayment] = useState('');
  const [subscriptionPlan, setsubscriptionPlan] = useState('')
  const [email, setEmail] = useState('');
  useEffect(() => {
    // return () => {
    getEmployerProfile()
    priceView()
    // }
  }, [])




  const getEmployerProfile = async () => {
    try {
      const response = await employeeProfile({});
      setEmail(response?.data?.details?.email)
      //   setLoading(false)
    } catch (error) {
      console.error('CNKKOCNAOKO', error);
    }
  }

  const Onsubmit = async () => {
      try {
        const response = await EmployeeSubscriptionRenewal({});

        if (response.status === 200) {
          const URL = response.data.details.url
          window.location.href = URL;
        }
      } catch (error) {
        console.error('SubscriptionRenewalerror:', error);
      }
  }


  const priceView = async () => {
    const productKey = ENV_CONFIG.PARTTIMER_PRODUCT_KEY;
    try {
      const product = await stripe.products.retrieve(productKey);

      if (product) {
        setsubscriptionPlan(product?.name)
        const priceid = product?.default_price
        const priceDetails = await stripe.prices.retrieve(priceid);
        setPayment(priceDetails?.unit_amount)
      }

    } catch (error) {
      console.error('Error retrieving product:', error);
    }
  }





  return (
    <div className="subscriptionPageContainer">
      <Grid container alignItems="center" justifyContent="center" spacing={6}>
        <Grid item xs={12}>
          <div className="mainTitle">Subscription Plan</div>
        </Grid>
        <Grid item xs={12} sm={6} lg={4}>
              <div className="subscriptionCard">
                <div className="subscriptionCardHeader" style={{backgroundImage: "url(" + BlueBg + ")"}}>
                    <div className="headerTitle">{subscriptionPlan}</div>
                    <div className="headerContent">
                      This plan typically provides access to job search 
                      functionalities such as the ability to view and apply for 
                      jobs, receive job alerts, and track applications.
                    </div>
                    <div className="HeaderAmount">
                      <strong>₹{payment / 100}/ year</strong> Per year
                    </div>
                </div>
                <div className="subscriptionCardBody">
                  <div className="subscriptionCardCheckListContainer">
                      <div className="subscriptionCardCheckListSet">
                          <img src={require('../../assets/images/check-icon.png')} alt=""/>
                          <span>
                            This feature provides job seekers with the ability to 
                            search for job listings based on their preferred criteria.
                          </span>
                      </div>
                      <div className="subscriptionCardCheckListSet">
                          <img src={require('../../assets/images/check-icon.png')} alt=""/>
                          <span>
                            This feature allows job seekers to track the status 
                            of their job applications, such as whether their 
                            resume has been viewed.
                          </span>
                      </div>
                      <div className="subscriptionCardCheckListSet">
                          <img src={require('../../assets/images/check-icon.png')} alt=""/>
                          <span>
                            This feature sends job seekers alerts when new 
                            job listings that match their criteria are posted.
                          </span>
                      </div>
                      <div className="subscriptionCardCheckListSet">
                          <img src={require('../../assets/images/check-icon.png')} alt=""/>
                          <span>
                            Some job portals provide job seekers with access to
                            company reviews and ratings.
                          </span>
                      </div>
                  </div>
                  <div className="subscriptionCardImg">
                    <PartTimerBanner/>
                  </div>
                  <Button onClick={Onsubmit} variant="contained" className="subscriptionBtn">
                    <span>Subscribe Now</span>
                    <EastIcon/>
                  </Button>
                </div>
              </div>
          </Grid>
